(function () {
    let tmpl = document.createElement('template');
    tmpl.innerHTML = `
        <style>
           
			.image-container {
				height: 455px;
				width:709px;
				background:url('data:image/png;base64,') no-repeat center center;
				background-size: cover;
			}
			.value {
                background-color: transparent;
                height: 20px;
				width: 150px;
                border: none;
                text-align: center;
				position: absolute;
				font-size: 14px;
				font-weight: 400;  
			}
			
            .name {
                background-color: transparent;
                height: 20px;
				width: 150px;
				border: none;
                text-align: center;
				position: absolute;
				font-size: 14px;  
				font-weight: 400;  
            }
			
			#v1{
				top: 220px;
				left: 280px;
			}
			#n1{
				top: 250px;
				left: 280px;
			}
			#v2{
				top: 325px;
				left: 115px;
			}
			#n2{
				top: 355px;
				left: 115px;
			}
			#v3{
				top: 325px;
				left: 455px;
			}			
			#n3{
				top: 355px;
				left: 455px;
			}

			.container{
				position: relative
			}
			
        </style>

			<div class="image-container"> </div>

			<input type="text" class="value" id="v1" disabled>
			<input type="text" class="value" id="v2" disabled>
			<input type="text" class="value" id="v3" disabled>
			
			<input type="text" class="name" id="n1" disabled>
			<input type="text" class="name" id="n2" disabled>
			<input type="text" class="name" id="n3" disabled>
			


    `;


   
   
 
class Podium extends HTMLElement {
    constructor() {
		console.log("constructor");
        super();
        this._shadowRoot = this.attachShadow({mode: 'open'});
        this._shadowRoot.appendChild(tmpl.content.cloneNode(true));

		this._value1 = this._shadowRoot.querySelector('#v1');
		this._value2 = this._shadowRoot.querySelector('#v2');
		this._value3 = this._shadowRoot.querySelector('#v3');
		
		this._name1 = this._shadowRoot.querySelector('#n1');
		this._name2 = this._shadowRoot.querySelector('#n2');
		this._name3 = this._shadowRoot.querySelector('#n3');
    }
	


	onCustomWidgetAfterUpdate(changedProperties) {
		console.log("onCustomWidgetAfterUpdate");
		console.log(changedProperties);
		if ("bold_forValues" in changedProperties) {
			this._updatevaluesBold(changedProperties["bold_forValues"]);
		}
		if ("bold_forNames" in changedProperties) {
			this._updatenamesBold(changedProperties["bold_forNames"]);
		}
		this.render();
	}

	async render(){
		const dataBinding = this.myDataBinding
		if (!dataBinding || dataBinding.state !== 'success') { return }
		const values = [];   
		dataBinding.data.forEach(row => {
		
			values.push({
				"raw" : row.measures_0.raw, 
				"label" : row.dimensions_0.label, 
				"formatted" : row.measures_0.formatted,
				"unit" : row.measures_0.unit});
		});
		values.sort((a, b) => a.raw - b.raw);
		
		let value2show = "";
		value2show = values[values.length-1].formatted + " " + values[values.length-1].unit;
		this._value1.value = value2show;
		
		value2show = values[values.length-2].formatted + " " + values[values.length-2].unit;
		this._value2.value = value2show;
		
		value2show = values[values.length-3].formatted + " " + values[values.length-3].unit;
		this._value3.value = value2show;
		
		this._name1.value = values[values.length-1].label;
		this._name2.value = values[values.length-2].label;
		this._name3.value = values[values.length-3].label;
	}
     
	_updatevaluesBold(bold) {
		const valueFields = this._shadowRoot.querySelectorAll('.value');
		valueFields.forEach(field => {

				field.style.fontWeight = bold;

		});
	}
	_updatenamesBold(bold) {
		const nameFields = this._shadowRoot.querySelectorAll('.name');
		nameFields.forEach(name => {

				name.style.fontWeight = bold;

		});
	}  
}

customElements.define('podium-widget', Podium);
})();